import './App.css';
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";

const App = createBrowserRouter([
  {
    path: "/",
    element: <div>Hello world!</div>,
  },
  {
    path: "/test",
    element: <div>Koozie</div>,
  },
]);


export default App;
